import './App.css';
import React from 'react';
import { useState } from 'react';
import autoClickBuy from './App'

function Upgrade(props) {

  return (
    <div className='upgradeList'>
        <h1>Upgrades:</h1>
        <div>
            <button onClick={autoClickBuy}>Auto Clicker: 10 Cookies</button>
            <button onClick={props.setScore(props.score - 50)}>Grandma: 50 Cookies</button>
            <button onClick={props.setScore(props.score - 100)}>Shipment: 100 Cookies</button>
        </div>
    </div>
  );
}

export default Upgrade;
